import React from 'react';
import igIcon from '../images/igIcon.png';
import fbIcon from '../images/fbIcon.png';

const Footer = () => (
 <div class="footer">
     <a href="https://www.instagram.com/staceylee2002/">
        <img class="socials" src={igIcon} alt="instagram" />
     </a>
 </div>
);

export default Footer;
